INSERT INTO `wp_p202s354gc_posts` VALUES (1,1,'2016-05-22 17:36:46','2016-05-22 17:36:46','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','publish','open','open','','hello-world','','','2016-05-22 17:36:46','2016-05-22 17:36:46','',0,'http://know-corp.com/?p=1',0,'post','',1),(2,1,'2016-05-22 17:36:46','2016-05-22 17:36:46','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://know-corp.com/wp/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','closed','open','','sample-page','','','2016-05-22 17:36:46','2016-05-22 17:36:46','',0,'http://know-corp.com/?page_id=2',0,'page','',0),(43,1,'2016-05-30 04:47:10','2016-05-30 04:47:10','','Scrum in under 10 minutes','','publish','closed','closed','','scrum-in-under-10-minutes','','','2016-05-30 05:17:47','2016-05-30 05:17:47','',0,'http://know-corp.com/?post_type=slide&#038;p=43',0,'slide','',0),(4,1,'2016-05-29 04:11:16','2016-05-29 04:11:16','[two_third last=\"yes\" spacing=\"yes\" center_content=\"no\" hide_on_mobile=\"no\" background_color=\"\" background_image=\"\" background_repeat=\"no-repeat\" ba